import React from 'react'
import {ReactComponent as CartLogo}  from '../../assets/cart.svg'
import './cart.scss'

const Cart =()=>{
return(
    <div className="cart-items" >
        <CartLogo className='shopping-icon' />
        <span className='item-count' >0</span>
    </div>
)
}
export default Cart
